import React from 'react';
import { Card, Button } from 'antd';
import { RetweetOutlined } from '@ant-design/icons';

const PostCard = () => {
    return (
        <div>
            <Card
                cover={post.Image[0] && <PostImages images={post.Images} />}
                actions={[
                    <RetweetOutlined />,
                ]}
            >
                <Image />
                <Content />
                <Button></Button>
            </Card>
            <CommentForm />
            <Comments />
        </div>
    );
};

export default PostCard;
